import React from 'react'; 
import { Menubar } from 'primereact/menubar';
import '../styles/.css';
export default function Navbar() {
    const items = [
        {
            label: 'Home',
            icon: 'pi pi-home',
            url: '/' // Link to the home page
        },
        {
            label: 'Features',
            icon: 'pi pi-star',
            url: '/features' // Link to the features page
        },
        {
            label: 'Projects',
            icon: 'pi pi-search',
            items: [
                {
                    label: 'Components',
                    icon: 'pi pi-bolt',
                    url: '/projects/components' // Link to the components page under projects
                },
                {
                    label: 'Blocks',
                    icon: 'pi pi-server',
                    url: '/projects/blocks' // Link to the blocks page under projects
                },
                {
                    label: 'UI Kit',
                    icon: 'pi pi-pencil',
                    url: '/projects/ui-kit' // Link to the UI Kit page under projects
                },
                {
                    label: 'Templates',
                    icon: 'pi pi-palette',
                    items: [
                        {
                            label: 'Apollo',
                            icon: 'pi pi-palette',
                            url: '/projects/templates/apollo' // Link to the Apollo template page under projects/templates
                        },
                        {
                            label: 'Ultima',
                            icon: 'pi pi-palette',
                            url: '/projects/templates/ultima' // Link to the Ultima template page under projects/templates
                        }
                    ]
                }
            ]
        },
        {
            label: 'Contact',
            icon: 'pi pi-envelope',
            url: '/contact' // Link to the contact page
        }
    ];

    return (
        <div className="card">
            <Menubar model={items} />
        </div>
    );
}
